import React, { useState } from "react";

const Header = () => {
    const [showHome, setShowHome] = useState(false);

    const showMeHome = () => {
        setshowHome(true);
    };

    return (
        <>
            <div className='flex flex-row items-center align-middle h-[10vh] p-4 header shadow-xl' onClick={showMeHome}>
                <img src="./images/logo.png" width={"60px"}/>
                <p className="px-2 text-xl uppercase" ><span className="font-bold">| Femmes</span> d'histoire</p>
            </div>            
        </>
    );
};

export default Header;
